import React, {Component} from 'react';
// import {Link} from 'react-router-dom';
import Loader from "./Loader";

class Cell extends Component {

    constructor(props) {
        super();
        this.state = {
            data: null,
            isLoading: false,
            error: null,
        };
        this.parent = props.parent;
        this.val = props.val;
    };

    cellFunction(){
        console.log(this.parent.val, this.val);
    }

    render() {
        return (
            <div className="border" style={{height:"15px"}} onClick={this.cellFunction}>
            </div>
        );
    }
}

export default Cell;
